import React from 'react';
import Page from '../../hoc/Page/Page';
import styles from './Professionals.module.css';
import DoctorImg from '../../assets/images/doctor.jpg';
import NurseImg from '../../assets/images/nurse.jpg';

const data = require('../../data.json');
const doctors = data.doctors;
const nurses = data.nurses;

const Professionals = () => {
  return (
    <Page>
      <div className={styles.Professionals}>
        <div className={styles.Doctors}>
          <h1>Doctors</h1>
          <table>
            <tr className={styles.TableHead}>
              <th><i className="fas fa-user-circle"></i> Picture</th>
              <th><i className="fas fa-signature"></i> Name</th>
              <th><i className="fas fa-globe-americas"></i> Country</th>
              <th><i className="fas fa-building"></i> Company</th>
            </tr>
            {doctors.map(person => (
              <tr className={styles.Person}>
                <td className={styles.AvatarTd}>
                  <img className={styles.Avatar} src={DoctorImg} alt="" />
                </td>
                <td className={styles.PersonName}>{person.name}</td>
                <td>{person.country}</td>
                <td>{person.company}</td>
              </tr>
            ))}
          </table>
        </div>

        <div className={styles.Nurses}>
          <h1>Nurses</h1>
          <table>
            <tr className={styles.TableHead}>
              <th><i className="fas fa-user-circle"></i> Picture</th>
              <th><i className="fas fa-signature"></i> Name</th>
              <th><i className="fas fa-globe-americas"></i> Country</th>
              <th><i className="fas fa-building"></i> Company</th>
            </tr>
            {nurses.map(person => (
              <tr className={styles.Person}>
                <td className={styles.AvatarTd}>
                  <img className={styles.Avatar} src={NurseImg} alt="" />
                </td>
                <td className={styles.PersonName}>{person.name}</td>
                <td>{person.country}</td>
                <td>{person.company}</td>
              </tr>
            ))}
          </table>
        </div>
      </div>
    </Page>
  );
};

export default Professionals;
